{"source":{"uri":"features/specs/validar_links_rodape_redes_sociais.feature","data":"#language: pt\n\nFuncionalidade: Links redes sociais no rodape\n\n    @links_sociais @link_facebook\n    Cenario: Validar o link do facebook\n\n        Dado acesso a pagina home \n        Quando clicar no link do Facebook\n        Então sou redirecionado para a pagina do facebook\n\n    @links_sociais @link_twitter\n    Cenario: Validar o link do Twitter\n\n        Dado acesso a pagina home\n        Quando clicar no link do Twitter\n        Então sou redirecionado para a pagina do Twitter\n  \n    @links_sociais @link_linkedin\n    Cenario: Validar o link do Linkedin\n\n        Dado acesso a pagina home\n        Quando clicar no link do Linkedin\n        Então sou redirecionado para a pagina do Linkedin\n    \n    \n    Cenario: Validar o link do Instagram\n\n        Dado acesso a pagina home\n        Quando clicar no link do Instagram\n        Então sou redirecionado para a pagina do Instagram\n    \n    @links_sociais @link_pinterest\n    Cenario: Validar o link do pinterest\n\n        Dado acesso a pagina home\n        Quando clicar no link do pinterest\n        Então sou redirecionado para a pagina do pinterest\n    \n    @links_sociais @link_medium\n    Cenario: Validar o link do medium\n\n        Dado acesso a pagina home\n        Quando clicar no link do medium\n        Então sou redirecionado para a pagina do medium\n\n        # Exemplos:\n        #     | rede_social | verifica_pagina                         |\n        #     | facebook    | https://www.facebook.com/PrintiBR/      |\n        #     | Twitter     | https://twitter.com/Printi              |\n        #     | Linkedin    | https://www.linkedin.com/company/printi |\n        #     | Instagram   | https://www.instagram.com/printibr/     |\n        #     | pinterest   | https://br.pinterest.com/printi/        |\n        #     | medium      | https://medium.com/printi-tech          |\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
